import {React} from 'react';
import Home from './Home.js';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import Main from './Main.jsx';

function App() {
    return (
        <Router>
             <Switch>
                <Route path="/">
                    <Home />
                </Route>
                <Route path="/Main" exact>
                    <Main />
                </Route>
            </Switch>
        </Router>
    )
}

export default App;
